import React from 'react'

import {BurgerWrapper} from './burgerstyled'


export default function Index({text, onClick, skeleton, ...props}) {
    return (
        <BurgerWrapper onClick={onClick} style={{backgroundColor: "rgba(0,0,0,0.2)"}}>
            {text}
        </BurgerWrapper>
    )
}
